import FormRow from '../components/FormRow'

const Home = () => {
  const [task, setTask] = useState()
  return (
    <>
      <main className='container'>
        <section>
          <h1>Task Manager</h1>
          <FormRow type='text' placeholder='e.g debug code' value={task} onChange/> 
           </section>
      </main>
    </>
  )
}

export default Home
